MA-Inclusive Green Growth DPL The Program Development Objectives of the programmatic DPL series are: 
PDO1. Improving the management of natural capital; 
PDO2. Greening physical capital; 
PDO3. Strengthening and diversifying the rural economy by leveraging human capital.

MA-Support to ONE (Office National de l'Electricit ) The objective of the Project is to increase the efficiency and reliability of electricity supply. This objective will be achieved through:

- Strengthening of the transmission and distribution infrastructure and supporting reductions in overall technical losses;
- Support to DSM programs to reduce electricity demand growth;
- Promotion of wind generation;
- Assistance to ONE to adjust toa new market environment.

Armenia Tax Administration Modernization Project The Project development objective (PDO) is to modernize Armenia's tax administration to (i) increase voluntary tax compliance, (ii)reduce tax evasion, (iii) reduce compliance costs; and (iv) increase administrative efficiency. This objective will be achieved by:

•	introducing modern, integrated information technology to support SRC operations; 
•	improving data exchange between the SRC and other agencies to enhance better risk management and targeting of compliance activities (“third party information”);
•	reengineeringand automation of business processes to improve efficiency and effectiveness; and 
•	expanding eGovernment, including e-filing and e-payments to lower the compliance burden for the private sector.

Ghana Local Government Capacity Support Project i. To strengthen the intergovernmental fiscal framework;
ii. To strengthen local public financial management and accountability for improved infrastructure and services in urban assemblies; and
iii. To improve citizens' engagement with urban assemblies and their perceptions of urban management.

Public Sector Modernization Project (a) To strengthen the performance of key budget organizations in budget formulation, budget execution, and public procurement; 
 (b) To establish the foundations for fiscally sustainable payroll management and effective human resource management in the core civil service; and 
 (c) To create conditions for further automation of government work processes and for development of e-government applications.

First Public Investment Reform Sppt Cr. - Improve the quality, reliability and accountability of the country's PFM and PIM systems; 
- Establish the policy and regulatory framework necessary for a well-functioning public irrigation sector, including a model for the multipurpose operation of the Kandadji Dam; 
- Facilitate the reform of the electricity sector.

Land Allocation for Social and Economic Development The development objective of the pilot program is to improve the process for identification and use of state lands transferred to eligible, poor and formerly landless or land-poor recipients selected through a transparent and well-targeted process as indicated by:
(a) the adoption rates of improved land management and agricultural production systems in SLC sub-projects;
(b) proportion of land recipients which meet poverty criteria and were landless or land-poor prior to project interventions;
(c) the effective implementation of dispute resolution procedures under the project, related to challenges to the land recipient selection process.

Emergency Multi-Sector HIV/AIDS Project The proposed emergency HIV/AIDS Multi-Sectoral Project aims at supporting the government response to the pandemic by:

 (a)	Strengthened access to and increased utilization of prevention services among vulnerable and high risk groups (such as women, youth, commercial sex workers, personnel of line ministries);

 (b)	Improved access and utilization of treatment and care services for HIV/AIDS infected and affected persons, notably the persons living with HIV/AIDS (including PLWHA and OVC).

MZ-Energy Development and Access Project (APL-2) The overall Project Development Objective is to accelerate access to electricity and modern energy services in peri-urban and rural areas in a sustainable and commercially viable manner.  Within that overall PDO the project will seek to support the Borrower to: 

 (a)	Increase grid-based access to and improve reliability of the supply of affordable electricity services in peri-rural areas ; 

 (b)	Increase off-grid access to electricity and modern energy services in unserved rural areas through conventional and renewable energy resources and technologies (RETs); 

 (c)	Leverage the mobilization of multi-lateral and bilateral donor financing for improving grid-based access to modern energy services through the reinforcement of the existing primary electricity network and the extension of the grid to un-served areas; 

 (d)	Improve the overall performance of the main sector institutions and their capacity to expand electrification and to mobilize new private sector and donor investment financing through the provision of institutional strengthening and capacity development support; and, 

 (e)	Elaborate a âNational Rural Electrification Strategy and Investment Programâ.

SN - Economic Governance Project The PDO is now “to enhance Senegal's investment climate through improvements in economic governance and the efficiency of commercial justice”. 
For the purpose of this project, economic governance means the policy, institutional, and behavioral framework that govern the activities of the private sector while efficiency of commercial justice refers to the speed of decisions of justice and the ease of access to justice for commercial cases. 
Revised PDO outcome indicators are: 
•	Number of cases pursued by CENTIF doubled from 12 to 24 by 2016;
•	The average time to enforce a commercial contract is reduced from 780 to 529 days by 2016;
•	Increase in the number of decisions taken per year at the TRHCD on Commercial Cases.

Central North Region Health Support Project The Project development objective is to strengthen district-level curative and preventive health services and improving their accessibility for the economically vulnerable population in the Central North Provinces. 

 Intermediate objectives are: 

 Increasing health insurance coverage among the near-poor population; 
 Upgrading capacities of district hospitals and District Preventive Health Centers; 
 Improving supply and quality of health care personnel.

GZ-Village and Neighborhood Development Project The Project Development Objective is: within a fragile context, to promote a coordinated development approach which builds the capacity of communities to plan for and manage development resources.  The key indicators for project success include: 
  a)	percentage of activities identified through the Area Development Plans that receive funding from other sources; 

 b)	percentage of projects with economically and/or socially marginalized groups as main beneficiaries.
